[mcu]
canbus_uuid: f4a842d1c8da


[mcu sb2040]
canbus_uuid: beab2f5f6284 #replacement board#
#canbus_uuid: 56623dd13b35 

##-----------THERMISTORS-----------------------##
[temperature_sensor SB2040]
sensor_type: NTC 100K MGB18-104F39050L32
sensor_pin: sb2040:gpio26
min_temp: 5
max_temp: 100

[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[temperature_sensor octopus]
sensor_type: temperature_mcu
min_temp: 10
max_temp: 100

[temperature_sensor Cartographer_MCU]
sensor_type:   temperature_mcu
sensor_mcu:            scanner
min_temp:                    0
max_temp:                  105

#[temperature_sensor enclosure]
#sensor_type: Generic 3950
#sensor_pin: PF5

[verify_heater heater_bed] check_gain_time: 150
##--------------------------------------------------------------------

[printer]
kinematics: corexy
max_velocity: 400 
max_accel: 8000       
max_z_velocity: 15          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5.0

[input_shaper]
shaper_freq_x: 58.8 # center frequency for the X axis filter
shaper_type_x: mzv  # filter type for the X axis
shaper_freq_y: 41.4 # center frequency for the Y axis filter
shaper_type_y: mzv  # filter type for the Y axis
damping_ratio_x: 0.051 # damping ratio for the X axis
damping_ratio_y: 0.044 # damping ratio for the Y axis


#####################################################################
#   X/Y Stepper Settings
#####################################################################

[stepper_x]
step_pin: PF13
dir_pin: PF12
enable_pin: !PF14
rotation_distance: 40
microsteps:32
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: sb2040:gpio29
position_min: 0
position_endstop: 350
position_max: 350

##--------------------------------------------------------------------
homing_speed: 200
homing_retract_dist: 5
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PC4
interpolate: false
# slow 
#run_current: 0.8
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0

[stepper_y]
step_pin: PG0
dir_pin: PG1
enable_pin: !PF15
rotation_distance: 40
microsteps:32
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: PG9
position_min: 0
position_endstop: 352
position_max: 355

##--------------------------------------------------------------------
homing_speed: 200  #Max 100
homing_retract_dist: 5
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: PD11
interpolate: false
#slow
#run_current: 0.8
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0
 
#####################################################################
#   Z Stepper Settings
#####################################################################

[stepper_z]
step_pin: PF11
dir_pin: PG3
enable_pin: !PG5
rotation_distance: 40
gear_ratio: 80:16
microsteps:32
endstop_pin: probe:z_virtual_endstop
position_max: 310
position_min: -5
homing_speed: 100
second_homing_speed: 100
homing_retract_dist: 0

[tmc2209 stepper_z]
uart_pin: PC6
interpolate: false
#slow
run_current: 0.8
#run_current: 1.2
sense_resistor: 0.110
stealthchop_threshold: 99999

[stepper_z1]
step_pin: PG4
dir_pin: !PC1
enable_pin: !PA0
rotation_distance: 40
gear_ratio: 80:16
microsteps:32

[tmc2209 stepper_z1]
uart_pin: PC7
interpolate: false
#slow
run_current: 0.8
#run_current: 1.2
sense_resistor: 0.110
stealthchop_threshold: 99999

[stepper_z2]
step_pin: PF9
dir_pin: PF10
enable_pin: !PG2
rotation_distance: 40
gear_ratio: 80:16
microsteps:32

[tmc2209 stepper_z2]
uart_pin: PF2
interpolate: false
#slow
run_current: 0.8
#run_current: 1.2
sense_resistor: 0.110
stealthchop_threshold: 99999

[stepper_z3]
step_pin: PC13
dir_pin: !PF0
enable_pin: !PF1
rotation_distance: 40
gear_ratio: 80:16
microsteps:32

[tmc2209 stepper_z3]
uart_pin: PE4
interpolate: false
#slow
run_current: 0.8
#run_current: 1.2
sense_resistor: 0.110
stealthchop_threshold: 99999

[virtual_sdcard]
path: /home/pi/printer_data/gcodes

#####################################################################
#   Extruder
#####################################################################
[extruder]

rotation_distance: 46.575
gear_ratio: 9:1
microsteps: 16
nozzle_diameter: 0.400
filament_diameter: 1.75
max_extrude_only_distance: 101
max_extrude_cross_section: 5.0
step_pin: sb2040:gpio9
dir_pin: sb2040:gpio10
enable_pin: !sb2040:gpio7
heater_pin: sb2040:gpio6
sensor_pin: sb2040:gpio27
sensor_type: PT1000
pullup_resistor: 1000
min_temp: 5
max_temp: 285
max_power: 1.0
min_extrude_temp: 170
pressure_advance: 0.0275
pressure_advance_smooth_time: 0.020
#control: pid
#pid_kp: 20.329
#pid_ki: 1.576
#pid_kd: 65.561

[tmc2209 extruder]
uart_pin: sb2040:gpio8
interpolate: false
run_current: 0.6
sense_resistor: 0.110
stealthchop_threshold: 0


#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
heater_pin: PA3
sensor_type: Generic 3950
sensor_pin: PF3
max_power: 0.8
min_temp: 0
max_temp: 122
#control: pid
#pid_kp: 49.728
#pid_ki: 2.255
#pid_kd: 274.124


#####################################################################
#   Fan Control
#####################################################################

## SB2040 cooling Fan##
[controller_fan SB2040_Fan]
pin: sb2040:gpio15
stepper: extruder
max_power: 1
#fan_speed: .8

##  Print Cooling Fan - FAN0
[fan]
pin: sb2040:gpio17
off_below: 0.10


##  Hotend Fan - FAN1
[heater_fan hotend_fan]
pin: sb2040:gpio14
max_power: 1.0
#kick_start_time: 0.5
heater: extruder
heater_temp: 50.0
##  If you are experiencing back flow, you can reduce fan_speed
#fan_speed: 1.0

##  Controller fan - FAN2
[controller_fan controller_fan]
pin: PD12
#kick_start_time: 0.5
heater: heater_bed
max_power: 1
fan_speed: 1

##  controller fan - FAN3
[controller_fan controller_fan2]
pin: PD13
#kick_start_time: 0.5
heater: heater_bed
max_power: 1
fan_speed: 1


